        private string FolderToHTML(string filename)
        {
            Stream input_stream = new FileStream( filename, FileMode.Open, FileAccess.Read, FileShare.Read );
            BinaryReader input = new BinaryReader( input_stream, Encoding.GetEncoding( "big5" ) );
            StringBuilder ret = new StringBuilder();

            ret.Append( "<ol>" );

            long reads = input_stream.Length / 256;
            byte[] buffer;
            for ( long i = 0 ; i < reads ; i++ )
            {
                string tmp, folder = "\x0";
                char type = '\x0';
                int separator;

                buffer = new byte[12]; //不知道有什麼用的 12 bytes
                buffer = input.ReadBytes( 12 );

                buffer = new byte[32]; //檔案名稱
                buffer = input.ReadBytes( 32 );
                tmp = Encoding.GetEncoding( "big5" ).GetString( buffer );
                separator = tmp.IndexOf( '\x0' );
                if ( separator > 0 ) tmp = tmp.Remove( separator );
                if ( tmp[0] == 'A' )
                {
                    //轉換文章
                    string article_path = base_path + tmp[tmp.Length - 1] + "\\" + tmp;
                    StringBuilder article = new StringBuilder();
                    article.Append( "<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">"
                                  + "<html xmlns=\"http://www.w3.org/1999/xhtml\" dir=\"ltr\">"
                                  + "<head>"
                                  + "<title>Untitled Document</title>"
                                  + "<meta http-equiv=\"content-type\" content=\"text/html; charset=UTF-8\" />"
                                  + "<link rel=\"stylesheet\" type=\"text/css\" href=\"../ansi.css\" />"
                                  + "</head>"
                                  + "<body id=\"article\">"
                                  + ArticleToHTML( article_path )
                                  + "</body>"
                                  + "</html>" );
                    File.WriteAllText( article_path + ".htm", article.ToString() ); //儲存HTML結果
                    File.Delete( article_path ); //刪除原始檔

                    ret.AppendFormat( "<li><a href=\"./{0}/{1}.htm\">", tmp[tmp.Length - 1], tmp );
                    type = 'A';
                }
                else if ( tmp[0] == 'F' )
                {
                    folder = base_path + tmp[tmp.Length - 1] + "\\" + tmp;
                    type = 'F';
                }

                buffer = new byte[80]; //作者
                buffer = input.ReadBytes( 80 );

                buffer = new byte[50]; //暱稱
                buffer = input.ReadBytes( 50 );

                buffer = new byte[9]; //日期：yy/mm/dd
                buffer = input.ReadBytes( 9 );

                buffer = new byte[73]; //主題
                buffer = input.ReadBytes( 73 );
                tmp = Encoding.GetEncoding( "big5" ).GetString( buffer );
                separator = tmp.IndexOf( '\x0' );
                if ( separator > 0 ) tmp = tmp.Remove( separator );
                if ( type == 'A' )
                {
                    ret.Append( tmp + "</a></li>" );
                }
                else if ( type == 'F' )
                {
                    //遞迴
                    ret.AppendFormat( "<li><span>{0}</span>{1}</li>", tmp.Replace( "&", "&amp;" ).Replace( "<", "&lt;" ).Replace( ">", "&gt;" ), FolderToHTML( folder ) );
                }
            }
            ret.Append( "</ol>" );

            //關閉檔案
            input.Close();

            return uao_b2u( ret.ToString() );
        }

        private string ArticleToHTML(string filename)
        {
            Stream input_stream = new FileStream( filename, FileMode.Open, FileAccess.Read, FileShare.Read );
            TextReader input = new StreamReader( input_stream, Encoding.GetEncoding( "big5" ) );

            //執行 UAO-Big5 to Unicode、解析 ANSI
            string html = ParseANSI( uao_b2u( input.ReadToEnd() ) );

            //關閉檔案
            input.Close();

            return html;
        }

